import{_ as t}from"./plugin-vue_export-helper.21dcd24c.js";import{o as i,c,d as s}from"./app.a3d402e1.js";const a={},p=s('<div class="custom-container tip"><p class="custom-container-title">\u524D\u8A00</p><p>\u5728 PMP \u4E2D\u5B58\u5728\u4E00\u5B9A\u7684\u8BA1\u7B97\u9898, \u4E00\u822C\u5206\u5E03\u5728\u8FDB\u5EA6\u7BA1\u7406\u548C\u6210\u672C\u7BA1\u7406\u7AE0\u8282, \u4EE5\u4E0B\u662F\u8BB0\u5F55\u8003\u8BD5\u4E2D\u4F1A\u4F7F\u7528\u5230\u7684\u516C\u5F0F\u4EE5\u53CA\u76F8\u5173\u540D\u8BCD\u89E3\u91CA\u3002</p></div><h2 id="\u7B2C\u56DB\u7AE0-\u6574\u5408\u7BA1\u7406" tabindex="-1"><a class="header-anchor" href="#\u7B2C\u56DB\u7AE0-\u6574\u5408\u7BA1\u7406" aria-hidden="true">#</a> \u7B2C\u56DB\u7AE0 \u6574\u5408\u7BA1\u7406</h2><h3 id="\u5546\u4E1A\u4EF7\u503C\u4E0E\u5F00\u53D1\u5468\u671F" tabindex="-1"><a class="header-anchor" href="#\u5546\u4E1A\u4EF7\u503C\u4E0E\u5F00\u53D1\u5468\u671F" aria-hidden="true">#</a> \u5546\u4E1A\u4EF7\u503C\u4E0E\u5F00\u53D1\u5468\u671F</h3><div class="custom-container tip"><p class="custom-container-title">\u63D0\u793A</p><p>\u6BD4\u503C = \u5546\u4E1A\u4EF7\u503C / \u5F00\u53D1\u5468\u671F</p></div><p>\u5728\u9009\u62E9\u9879\u76EE\u7684\u4F18\u5148\u7EA7\u65F6, \u6BD4\u503C\u8D8A\u9AD8, \u5E94\u8BE5\u88AB\u4F18\u5148\u9009\u62E9</p><h2 id="\u7B2C\u516D\u7AE0-\u8FDB\u5EA6\u7BA1\u7406" tabindex="-1"><a class="header-anchor" href="#\u7B2C\u516D\u7AE0-\u8FDB\u5EA6\u7BA1\u7406" aria-hidden="true">#</a> \u7B2C\u516D\u7AE0 \u8FDB\u5EA6\u7BA1\u7406</h2><h3 id="\u4E09\u70B9\u4F30\u7B97" tabindex="-1"><a class="header-anchor" href="#\u4E09\u70B9\u4F30\u7B97" aria-hidden="true">#</a> \u4E09\u70B9\u4F30\u7B97</h3><p>\u6E90\u81EA\u8BA1\u5212\u8BC4\u5BA1\u6280\u672F\uFF08PERT\uFF09\u3002\u8003\u8651\u4F30\u7B97\u4E2D\u7684\u4E0D\u786E\u5B9A\u6027\u548C\u98CE\u9669, \u6765\u63D0\u9AD8\u4F30\u7B97\u7684\u51C6\u786E\u6027\u3002</p><p>\u4E09\u4E2A\u4F30\u7B97\u503C\uFF1A\u6700\u53EF\u80FD\u65F6\u95F4\u3001\u6700\u4E50\u89C2\u65F6\u95F4\u3001\u6700\u60B2\u89C2\u65F6\u95F4</p><div class="custom-container tip"><p class="custom-container-title">\u4E09\u89D2\u5206\u5E03</p><p>\u671F\u671B\u503C\uFF08\u5E73\u5747\u503C\uFF09= (\u6700\u60B2\u89C2 + \u6700\u4E50\u89C2 + \u6700\u53EF\u80FD) / 3</p></div><div class="custom-container tip"><p class="custom-container-title">\u8D1D\u5854\u5206\u5E03 \uFF08\u9ED8\u8BA4\u5206\u5E03\uFF09</p><p>\u671F\u671B\u503C\uFF08\u5E73\u5747\u503C\uFF09= (\u6700\u60B2\u89C2 + \u6700\u4E50\u89C2 + \u6700\u53EF\u80FD * 4) / 6</p></div><div class="custom-container tip"><p class="custom-container-title">\u6807\u51C6\u5DEE</p><p>\u6807\u51C6\u5DEE = (\u6700\u60B2\u89C2 - \u6700\u4E50\u89C2) / 6</p></div><h2 id="\u7B2C\u4E03\u7AE0-\u6210\u672C\u7BA1\u7406" tabindex="-1"><a class="header-anchor" href="#\u7B2C\u4E03\u7AE0-\u6210\u672C\u7BA1\u7406" aria-hidden="true">#</a> \u7B2C\u4E03\u7AE0 \u6210\u672C\u7BA1\u7406</h2><ul><li>BAC =&gt; \u5B8C\u5DE5\u9884\u7B97, \u5373\u6210\u672C\u57FA\u51C6\uFF08\u4E0D\u8003\u8651\u7BA1\u7406\u50A8\u5907\uFF09</li><li>PV =&gt; \u8BA1\u5212\u4EF7\u503C, \u5373\u5230\u76EE\u524D\u4E3A\u6B62, \u8BA1\u5212\u505A\u591A\u5C11</li><li>EV =&gt; \u6323\u503C, \u5373\u5230\u76EE\u524D\u4E3A\u6B62, \u76EE\u524D\u5DF2\u7ECF\u505A\u4E86\u591A\u5C11</li><li>AC =&gt; \u5B9E\u9645\u6210\u672C, \u5373\u5230\u76EE\u524D\u4E3A\u6B62, \u5B9E\u9645\u82B1\u4E86\u591A\u5C11</li><li>SV =&gt; \u8FDB\u5EA6\u504F\u5DEE</li><li>CV =&gt; \u6210\u672C\u504F\u5DEE</li><li>SPI =&gt; \u8FDB\u5EA6\u7EE9\u6548\u6307\u6570</li><li>CPI =&gt; \u6210\u672C\u7EE9\u6548\u6307\u6570</li><li>TCPI =&gt; \u5B8C\u5DE5\u5C1A\u9700\u7EE9\u6548\u6307\u6570</li><li>EAC =&gt; \u5B8C\u5DE5\u4F30\u7B97</li><li>ETC =&gt; \u5B8C\u5DE5\u5C1A\u9700\u4F30\u7B97\uFF08\u4F7F\u7528\u65B0\u7684\u4F30\u7B97\u65B9\u5F0F\uFF09</li><li>VAC =&gt; \u5B8C\u5DE5\u504F\u5DEE</li></ul><div class="custom-container tip"><p class="custom-container-title">BAC\uFF08\u5B8C\u5DE5\u9884\u7B97\uFF09</p><p>BAC = \u5B8C\u5DE5\u65F6\u7684 PV \u7684\u603B\u548C BAC = EV</p></div><div class="custom-container tip"><p class="custom-container-title">PV\uFF08\u8BA1\u5212\u4EF7\u503C\uFF09</p><p>BAC = \u8BA1\u5212\u5DE5\u4F5C\u91CF * \u9884\u7B97\u5355\u4EF7</p></div><div class="custom-container tip"><p class="custom-container-title">EV\uFF08\u6323\u503C\uFF09</p><p>EV = \u5B9E\u9645\u5DE5\u4F5C\u91CF * \u9884\u7B97\u5355\u4EF7</p></div><div class="custom-container tip"><p class="custom-container-title">AC\uFF08\u5B9E\u9645\u6210\u672C\uFF09</p><p>EV = \u5B9E\u9645\u5DE5\u4F5C\u91CF * \u5B9E\u9645\u5355\u4EF7</p></div><div class="custom-container tip"><p class="custom-container-title">SV\uFF08\u8FDB\u5EA6\u504F\u5DEE\uFF09</p><p>SV = EV - PV</p></div><div class="custom-container tip"><p class="custom-container-title">CV\uFF08\u6210\u672C\u504F\u5DEE\uFF09</p><p>CV = EV - AC</p></div><div class="custom-container tip"><p class="custom-container-title">SPI\uFF08\u8FDB\u5EA6\u7EE9\u6548\u6307\u6570\uFF09</p><p>SPI = EV / PV</p></div><div class="custom-container tip"><p class="custom-container-title">CPI\uFF08\u6210\u672C\u7EE9\u6548\u6307\u6570\uFF09</p><p>CPI = EV / AC</p></div><div class="custom-container tip"><p class="custom-container-title">EAC\uFF08\u6210\u672C\u4F30\u7B97\uFF09</p><p>EAC = AC + ETC</p></div><div class="custom-container tip"><p class="custom-container-title">EAC\uFF08\u5178\u578B\u504F\u5DEE\uFF09</p><p>EAC = AC + (BAC - EV) / CPI = BAC / CPI</p></div><div class="custom-container tip"><p class="custom-container-title">EAC\uFF08\u975E\u5178\u578B\u504F\u5DEE\uFF09</p><p>EAC = AC + (BAC - EV) / 1 = AC + BAC - EV</p></div><div class="custom-container tip"><p class="custom-container-title">EAC\uFF08\u8FDB\u5EA6\u6210\u672C\u540C\u65F6\u4F5C\u7528, \u6210\u672C\u8D85\u652F\u6216\u8FDB\u5EA6\u843D\u540E\uFF09</p><p>EAC = AC + (BAC - EV) / (CPI * SPI)</p></div><div class="custom-container tip"><p class="custom-container-title">\u5269\u4F59\u8D44\u91D1</p><p>\u5269\u4F59\u8D44\u91D1 =&gt; EAC - AC</p></div><div class="custom-container tip"><p class="custom-container-title">\u5269\u4F59\u8D44\u91D1</p><p>\u5269\u4F59\u5DE5\u4F5C =&gt; EAC - EV</p></div><div class="custom-container tip"><p class="custom-container-title">TCPI\uFF08\u5B8C\u5DE5\u5C1A\u9700\u7EE9\u6548\u6307\u6570\uFF09</p><p>TCPI = (BAC - EV) / (BAC - AC)</p></div><div class="custom-container tip"><p class="custom-container-title">VAC\uFF08\u5B8C\u5DE5\u504F\u5DEE\uFF09</p><p>VAC = BAC - EAC</p></div><h2 id="\u7B2C\u516B\u7AE0-\u8D28\u91CF\u7BA1\u7406" tabindex="-1"><a class="header-anchor" href="#\u7B2C\u516B\u7AE0-\u8D28\u91CF\u7BA1\u7406" aria-hidden="true">#</a> \u7B2C\u516B\u7AE0 \u8D28\u91CF\u7BA1\u7406</h2><div class="custom-container tip"><p class="custom-container-title">\u63A7\u5236\u8303\u56F4</p><p>+- 3 \u897F\u683C\u739B</p></div><h2 id="\u7B2C\u5341\u7AE0-\u6C9F\u901A\u7BA1\u7406" tabindex="-1"><a class="header-anchor" href="#\u7B2C\u5341\u7AE0-\u6C9F\u901A\u7BA1\u7406" aria-hidden="true">#</a> \u7B2C\u5341\u7AE0 \u6C9F\u901A\u7BA1\u7406</h2><div class="custom-container tip"><p class="custom-container-title">\u6C9F\u901A\u6E20\u9053</p><p>\u6C9F\u901A\u6E20\u9053 = n(n-1)/2</p></div><h2 id="\u7B2C\u5341\u4E8C\u7AE0-\u9879\u76EE\u91C7\u8D2D\u7BA1\u7406" tabindex="-1"><a class="header-anchor" href="#\u7B2C\u5341\u4E8C\u7AE0-\u9879\u76EE\u91C7\u8D2D\u7BA1\u7406" aria-hidden="true">#</a> \u7B2C\u5341\u4E8C\u7AE0 \u9879\u76EE\u91C7\u8D2D\u7BA1\u7406</h2><div class="custom-container tip"><p class="custom-container-title">\u603B\u4EF7+\u6FC0\u52B1\uFF08FPIF\uFF09</p><p>\u603B\u4EF7 = \u5B9E\u9645\u6210\u672C + \u76EE\u6807\u5229\u6DA6 +\uFF08\u76EE\u6807\u6210\u672C - \u5B9E\u9645\u6210\u672C\uFF09* \u5356\u65B9\u5E94\u627F\u62C5\u6BD4\u4F8B</p><p>\u5148\u7B97\u603B\u4EF7, \u548C\u6700\u9AD8\u9650\u4EF7\u6BD4\u8F83, \u8BA1\u7B97\u6700\u7EC8\u603B\u4EF7\u3002</p><p>\u5B9E\u9645\u5229\u6DA6 = \u6700\u7EC8\u603B\u4EF7 - \u5B9E\u9645\u6210\u672C</p></div><div class="custom-container tip"><p class="custom-container-title">\u6210\u672C+\u6FC0\u52B1\uFF08CPIF\uFF09</p><p>\u5229\u6DA6 = \u76EE\u6807\u5229\u6DA6 + \uFF08\u76EE\u6807\u6210\u672C - \u5B9E\u9645\u6210\u672C\uFF09* \u5356\u65B9\u5E94\u627F\u62C5\u6BD4\u4F8B</p><p>\u5148\u7B97\u5229\u6DA6, \u548C\u5229\u6DA6\u4E0A\u4E0B\u9650\u6BD4, \u8BA1\u7B97\u6700\u7EC8\u5229\u6DA6</p><p>\u5B9E\u9645\u603B\u4EF7 = \u6700\u7EC8\u5229\u6DA6 + \u5B9E\u9645\u6210\u672C</p></div><div class="custom-container tip"><p class="custom-container-title">\u6210\u672C\u2014\u2014\u56FA\u5B9A\u8D39\u7528\uFF08CPFF\uFF09</p><p>\u5B9E\u9645\u603B\u4EF7 = \u5B9E\u9645\u6210\u672C + \u521D\u59CB\u6210\u672C\u767E\u5206\u6BD4</p></div>',38),e=[p];function n(o,l){return i(),c("div",null,e)}var u=t(a,[["render",n],["__file","formula.html.vue"]]);export{u as default};
